export default function CouponsCustomerSidebar() {
    return (
        <div className='CouponsCustomerSidebar'>
            <div className='action-sidebar'>
                <div className='action-sidebar-button'>
                    <button onClick={() => alert(123)}>TEMP</button>
                </div>
            </div>
        </div>
    )
}
